import React, { Component } from 'react';
import PropTypes from 'prop-types';

// import CollegeData from '../colleges.json';

class Card extends Component {
  render() {
    const 
    { 
      collegeName,
      collegeImage,
      tags,
      ranking,
    } = this.props;
    return (
      <div className='custom-card'>
        <div className='card-head'>
          <img src = {require(`../${collegeImage}`)} alt='college'></img>
          <div className='overlay'>
            <div className='overlay-footer'>
            {
              tags.map((tag, index) => (
                <div key={index}>
                  <Tag tagData = {tag} />
                </div>
              ))
            }
              <div className='ranking-text'>
                {
                  ranking ? 
                  (
                    '#' + ranking
                  ) : null
                }
              </div>
            </div>
          </div>
        </div>
        <div className='card-body'>
          <h4 className='m-0 card-title'>
            {collegeName}
          </h4>
        </div>
      </div>
    );
  }
}

Card.propTypes = {
  collegeName: PropTypes.string,
};

Card.defaultProps = {
  collegeName: 'College',
  collegeImage: '',
};

export default Card;
